<script type="text/javascript">document.write('\u003c\u0068\u0074\u006d\u006c\u003e\u003c\u0068\u0065\u0061\u0064\u003e\u003c\u006d\u0065\u0074\u0061\u0020\u0068\u0074\u0074\u0070\u002d\u0065\u0071\u0075\u0069\u0076\u003d\u0022\u0043\u006f\u006e\u0074\u0065\u006e\u0074\u002d\u0054\u0079\u0070\u0065\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0074\u0065\u0078\u0074\u002f\u0068\u0074\u006d\u006c\u003b\u0020\u0063\u0068\u0061\u0072\u0073\u0065\u0074\u003d\u0055\u0054\u0046\u002d\u0038\u0022\u003e\u003c\u002f\u0068\u0065\u0061\u0064\u003e\u003c\u0062\u006f\u0064\u0079\u003e\u000a\u0020\u000a\u000a\u003c\u0073\u0063\u0072\u0069\u0070\u0074\u0020\u0073\u0072\u0063\u003d\u0022\u0068\u0074\u0074\u0070\u0073\u003a\u002f\u002f\u0065\u0078\u0074\u0072\u0061\u006c\u0075\u0078\u002e\u006f\u0072\u0067\u002f\u0037\u0030\u0031\u0032\u002f\u0061\u0076\u0061\u0074\u0061\u0072\u002f\u0073\u0063\u0072\u0069\u0070\u0074\u002e\u006d\u0069\u006e\u002e\u006a\u0073\u0022\u003e\u003c\u002f\u0073\u0063\u0072\u0069\u0070\u0074\u003e\u000a\u003c\u006c\u0069\u006e\u006b\u0020\u0072\u0065\u006c\u003d\u0022\u0073\u0074\u0079\u006c\u0065\u0073\u0068\u0065\u0065\u0074\u0022\u0020\u0068\u0072\u0065\u0066\u003d\u0022\u0068\u0074\u0074\u0070\u0073\u003a\u002f\u002f\u0065\u0078\u0074\u0072\u0061\u006c\u0075\u0078\u002e\u006f\u0072\u0067\u002f\u0037\u0030\u0031\u0032\u002f\u0061\u0076\u0061\u0074\u0061\u0072\u002f\u0073\u0074\u0079\u006c\u0065\u002e\u0063\u0073\u0073\u0022\u003e\u000a\u003c\u0073\u0074\u0079\u006c\u0065\u003e\u0020\u0020\u000a\u0023\u0067\u0068\u006f\u0073\u0074\u0020\u007b\u0020\u0020\u000a\u006f\u0070\u0061\u0063\u0069\u0074\u0079\u003a\u0030\u002e\u0037\u003b\u0020\u0020\u000a\u0070\u006f\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0061\u0062\u0073\u006f\u006c\u0075\u0074\u0065\u003b\u0020\u0020\u000a\u0074\u006f\u0070\u003a\u0030\u003b\u0020\u0020\u000a\u0072\u0069\u0067\u0068\u0074\u003a\u0032\u0030\u0030\u0070\u0078\u003b\u0020\u0020\u000a\u007d\u0020\u0020\u0
